函数作为返回值

禁止套娃&#x1F601;

func play1(value:Int) -> Int {
    return value * value
}

func play2(value:Int) -> Int {
    return value + value
}

func test(param:Bool) -> (Int) -> Int {
    return param ? play1 : play2
}

let a = test(param: true) // 此时a为play1

a(3) // 9

内嵌函数
和上面的套娃一样，更改成内嵌的方式书写
func test1(param:Bool) -> (Int) -> Int {

    func play1(value:Int) -> Int {
        return value * value
    }

    func play2(value:Int) -> Int {
        return value + value
    }

    return param ? play1 : play2
}

let b = test1(param: false) // 此时b为play2

b(3) // 6

